import React from 'react';

export default React.forwardRef(({mp4, webm, videoRef}) =>
    <video className="letPerfumeTalk__video"
           autoPlay={true}
           loop={true}
           muted={true}
           ref={videoRef}
    >
        <source src={mp4} type='video/mp4; codecs="avc1.4D401E, mp4a.40.2"'/>
        <source src={webm} type="video/webm"/>
    </video>)
